CREATE TABLE `bank_card_info` (
  `seq` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `bank_name` varchar(64) DEFAULT NULL,
  `bank_code` varchar(32) NOT NULL,
  `bank_type` varchar(16) DEFAULT NULL,
  `card_type` varchar(8) NOT NULL,
  `card_type_name` varchar(32) DEFAULT NULL,
  `card_name` varchar(64) DEFAULT NULL,
  `card_header_len` tinyint(3) unsigned NOT NULL,
  `card_header` varchar(64) NOT NULL,
  `card_len` tinyint(3) unsigned NOT NULL,
  `status` smallint(1) unsigned NOT NULL DEFAULT '0',
  `updatetime` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`seq`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;

